import { useState } from "react";

const InfoPaneluserHome = () => {
    const [page, setPage] = useState("default")

    const overviewFunc = () => {
        return (
            <span>Welcome to the Overview page!</span>
        )
    }

    const playTimeFunc = () => {
        return (
            <span>Welcome to the playtime page!</span>
        )
    }

    const content = () => {
        switch (page) {
            case "default":
                return overviewFunc()
            case "playtime":
                return playTimeFunc()
            default:
                return overviewFunc()
        }
    }

    return (
        <div className="InfoPaneluserHomeContainer">
            <div className="InfoPaneluserHomeMenuContainer">
                <div className="InfoPaneluserHomeMenuContainerInner">
                    <p>MENU</p>
                    <div className="InfoPaneluserHomeMenuLine" />
                    <span>Overview</span>
                    <span style={{ color: "rgba(255,255,255,0.25)" }}>Creating a server</span>
                    <span style={{ color: "rgba(255,255,255,0.25)" }}>Logs</span>
                    <span>Play time</span>
                    <span style={{ color: "rgba(255,255,255,0.25)" }}>Changing server settings</span>
                    <span style={{ color: "rgba(255,255,255,0.25)" }}>Changing user settings</span>
                </div>
            </div>
            <div className="InfoPaneluserHomeContentContainer">
                {content}
                <div className="InfoPaneluserHomeContentTitleContainer">

                </div>
                <div className="InfoPaneluserHomeContentMainConatiner">

                </div>
            </div>
        </div>
    )
}

export default InfoPaneluserHome
